import React, { Component } from "react";

class Form extends Component {
  state = {
    username: "",
    password: "",
  };
  render() {
    return (
      <div>
        <div>Form Component</div>
        <form>
          <label>
            {" "}
            Username:
            <input type="text" value={this.state.username} />
          </label>
          <br />
          <label>
            {" "}
            Password:
            <input type="password" value={this.state.password} />
          </label>
        </form>
      </div>
    );
  }
}

export default Form;
